- proto: Paper
  entities:
  - uid: 497
    components:
    - type: Transform
      pos: 11.341163,8.08868
      parent: 1
    - type: Paper
      content: "[color=#1b67a5]      [head=2]SV-Caldari 2124 Manual[/head]\r\n     [head=3]By AstralShipyards[/head]\r\n                       \n\r\nCongratulations on your purchase of the SV Caldari-class mining and salvage vessel!\n\nThe Caldari is designed for deep space mining and salvage operations, with basic amenities such as a lounge, crew quarters with private lockers, a bathroom, an armory (weapons not included), a small janitorial station, a basic medbay (medical supplies not included), a large cargo hold, and a fully detailed bridge with a panic button in case of assault or severe damage. \n\nIncluded in your purchase are 60 units of uranium for your power generators, and one set of extra atmospheric cannisters. Please give the preflight checklist a read before undocking.\n\n\n                     [head=4]Important Notes[/head]\n\n* There are three fire extinguishers located in the bridge, atmospheric room, and in engineering. Please memorize these locations in case of emergency, and educate your crew on proper fire fighting techniques. \n\n* Each window has its own set of shutters controled via nearby button.\n\n* The airtight flaps have their shutter closed by default. The nearby buttons will open them.\n\n* There is a panic button on the bridge that closes all shutters.\n\n* The EVA equipment is located in the bow of the ship. You have 4 suits, for 2 miners and 2 salvage specialists. All other equipment you may need are found in the dorms lockers.\n\n\n                     [head=4]Pre-Light Checklist[/head]\n\n[bold]Atmosphere:[/bold]\n[  ] Ensure the air cannisters in the atmospheric room (located on the aft-starboard corner of the ship) are properly anchored on their respective pads.\n[  ] Ensure the gas mixer is turned on, and set to 21% oxygen and 79% Nitrogen, with 101.325 kPa of pressure. \n[  ]Ensure the waste pipe is turned on, and also set to 101.325 kPa of pressure. \n[  ] Ensure the air injector located just outside of the atmos room, is turned on and venting air\n\n[bold]Engineering:[/bold]\n[  ] Ensure you have \n   -2 working SMES batteries\n   -1 working substation\n   -1 gyroscope\n   -1 mini-gravity generator\n   -1 S.U.P.E.R.P.A.C.M.A.N. Portable Generator \n[  ] Ensure they are all powered and achored. \n[  ] The generator should be connected to either of the green boxes on the ground\n[  ] The two SMES batteries should be on the orange boxes, with a cable terminal in front of both, and an HV wire coil connecting them to the generators\n[  ] The substation should be right next to the SMES battries on a yellow box, with an HV coil connecting all three\n[  ] The gyroscope and minigrav generator should be on the blue boxes in the final corner of the room.\n[  ] Check the two APCs, located in the bridge and right outside of the engineering room. Ensure they are powered on and charging with a good load. \n[  ] Ensure the generator is running at 30kw\n\n\n                     [head=4]Upgrade Guide[/head]\n\n* There is space to upgrade the power with a second generator. At unmodified comsumption, you only need a single generator at 30kw to power the entire thing, however upgrades will require an additional generator for peak effeciency.\n\n* If you wish to convert the ship into a science vessel, place the R&D server and console in the bridge, opposite of the camera server. Please avoid blocking the shutter buttons. Artifact scanners and consoles should be placed in the port hallway, in case of explosions. You will need to add your own valves. The cargo hold is large enough to support lathes of all types. \n\n* If you wish to convert the ship into a diner, remove the conveyors and tiling in the cargo section with wood paneling and glass in the center. There is room for at least 4 tables to fit comfortably. Remove the medbay and replace it with a hydroponics station. \n*You can also add 3 hydroponic trays in the atmospheric room against the wall if you're looking for a much smaller scale food production on journies where food ships are unavailable.\n\n* If you wish to convert the ship into a medical search and rescue vessel, remove the conveyors and add two cyro pods and some statis beds in the cargo section. Convert the current medbay into a morgue. On the port side of the cargohold, you can add a cloning suite. \n\n* If you are a vain asshole who thinks they are better than the rest of the crew, you may tear up the flooring of the armory and convert it into a captain's quarters.\n\n\n                     [head=4]Final Words[/head]\n\n[color=#AAAAAA]NanoTressen and AstralShipyards are not responsible for injury or loss of life while off station. Shuttles are sold as is, and any modification voids any warrenty or liablity. You understand space is inherently dangerous and waive any responsbility for safety expectations on NanoTressen or AstralShipyards. Also we own your soul. Warrenties are only valid if signed and faxed to CentComm within 90 seconds of purchase.[/color]\n\nSafe flying!\n\n\n\n\nSign here:\n\n\n"
